      <div className="menu-main__container">
        <article>
          <Card order={props.orders.orders[0]} />
          <Card order={props.orders.orders[1]} />
          <Card order={props.orders.orders[2]} />
        </article>
        <article>
          <Card order={props.orders.orders[3]} />
          <Card order={props.orders.orders[4]} />
          <Card order={props.orders.orders[5]} />
        </article>
        <article>
          <Card order={props.orders.orders[6]} />
          <Card order={props.orders.orders[7]} />
          <Card order={props.orders.orders[8]} />
        </article>
      </div>
    </div>
  );
};

export default Menu;
